import React from "react";
import {Redirect} from "react-router-dom";

// Authentication related pages
import Login from "../pages/Authentication/Login";
import Logout from "../pages/Authentication/Logout";
import Register from "../pages/Authentication/Register";
import ForgetPwd from "../pages/Authentication/ForgetPassword";
import AuthLockScreen from "../pages/Authentication/AuthLockScreen";

// Dashboard
import Dashboard from "../pages/Dashboard/index";

// Camera
import Camera from "../pages/Camera/index";

// Camera List
import CameraList from "../pages/CameraList/index";

// Confidence Levels
import ConfidenceLevels from "../pages/ConfidenceLevels/index";

// Profile
import Profile from "../pages/Profile/index";

// Settings
import Settings from "../pages/Settings/index";

const authProtectedRoutes = [
	//Camera
	{path: "/camera", component: Camera},

	//Camera
	{path: "/camera-list", component: CameraList},

	//Camera
	{path: "/confidence-levels", component: ConfidenceLevels},

	//Profile
	{path: "/profile", component: Profile},

	//Settings
	{path: "/settings", component: Settings},

	{path: "/dashboard", component: Dashboard},

	// this route should be at the end of all other routes
	{path: "/", exact: true, component: () => <Redirect to="/dashboard" />},
];

const publicRoutes = [
	{path: "/logout", component: Logout},
	//{path: "/login", component: Login},
	{path: "/forgot-password", component: ForgetPwd},
	{path: "/register", component: Register},
	{path: "/auth-lock-screen", component: AuthLockScreen},
];

export {authProtectedRoutes, publicRoutes};
